  false,\n\t\"url\": null,\n\t\"notes\": \"This data set comprises an update of the
  Environmental Sensitivity Index (ESI) data for the Virgin Islands. ESI data characterize
  estuarine environments and wildlife by their sensitivity to spilled oil. The ESI
  data include information for three main components: shoreline habitats, sensitive
  biological resources, and human-use resources. The ESI data were collected, mapped,
  and digitized to provide environmental data for oil spill planning and response.
  The Clean Water Act with amendments by the Oil Pollution Act of 1990 requires response
  plans for immediate and effective protection of sensitive resources.nThis digital
  data re-release includes shoreline, hydrological, and biological data in formats
  for GIS systems and as Adobe Acrobat maps with extensive documentation. These data
  were originally distributed as a DVD product.\",\n\t\"license_title\": null,\n\t\"extras\":
